/******************************************************************

Stylesheet: ベーススタイル

******************************************************************/
* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
  -webkit-overflow-scrolling: touch;
  font-family: "M PLUS 1p", sans-serif;
}

body {
  overflow: hidden;
}

h2,
.heading {
  position: relative;
  font-size: 40px;
  font-weight: 900;
  font-style: italic;
  color: #fff8fd;
}

h3 {
  font-size: 35px;
  font-weight: 900;
}

p {
  font-size: 24px;
}

span.break {
  display: block;
}
span.number {
  font-size: 42px;
}

.italic {
  font-style: italic;
}

.section {
  position: relative;
  text-align: center;
  background-color: orange;
}
.section__heading {
  position: absolute;
  z-index: 300;
  top: 45px;
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
}
.section__heading h2 {
  padding: 0 15px;
  opacity: 0;
  transition: 0.5s;
}
.section__heading h2.inview {
  opacity: 1;
}
.section__heading h2::before, .section__heading h2::after {
  content: "";
  position: absolute;
  top: 50%;
  width: 100vw;
  height: 1px;
  display: block;
  background-color: #fff8fd;
  transition: all 1.5s ease 0.2s;
  transition-delay: 0.5s;
}
.section__heading h2::before {
  right: 100%;
  transform: translateY(-50%) scaleX(0);
  transform-origin: right;
}
.section__heading h2.inview::before {
  transform: translateY(-50%);
}
.section__heading h2::after {
  left: 100%;
  transform: translateY(-50%) scaleX(0);
  transform-origin: left;
}
.section__heading h2.inview::after {
  transform: translateY(-50%);
}
.section .content {
  position: relative;
  z-index: 200;
  width: 100%;
  max-width: 1050px;
  margin: 0 auto;
  opacity: 0;
  transform: translateY(50px);
  transition: opacity 0.3s, transform 0.5s;
}
.section .content.active {
  opacity: 1;
  transform: none;
}
.section .content p {
  margin: 10px 0;
  font-size: 24px;
  font-weight: 700;
}

.header {
  position: fixed;
  z-index: 1000;
  width: 100vw;
  height: 60px;
  transition: 0.5s;
}
.header__inner {
  position: relative;
  display: flex;
  align-items: center;
  width: 100%;
  height: 100%;
  max-width: 1050px;
  margin: 0 auto;
  padding: 0 10px;
}
