  position: absolute;
  left: 10px;
  padding-right: 15px;
  letter-spacing: 1px;
  font-size: 40px;
  color: #151515;
}
.header__inner .buttons {
  position: absolute;
  top: 50%;
  right: 10px;
  transform: translateY(-50%);
  display: flex;
  align-items: center;
