  position: absolute;
  width: 100%;
  height: 100%;
  text-align: center;
  background: linear-gradient(135deg, rgba(255, 248, 253, 0.9) 50%, rgba(21, 21, 21, 0.9) 50%);
  background-size: 200% 200%;
  background-position: 100% 100%;
