.header__inner .buttons .languages li:nth-child(1) {
  transition-delay: 0.1s, 0s;
}
.header__inner .buttons .languages li:nth-child(2) {
  transition-delay: 0.2s, 0s;
}
.header__inner .buttons .languages li:nth-child(3) {
  transition-delay: 0.3s, 0s;
}
.header__inner .buttons .languages li:nth-child(4) {
  transition-delay: 0.4s, 0s;
}
.header__inner .buttons .languages li:nth-child(5) {
  transition-delay: 0.5s, 0s;
}
.header__inner .buttons .languages li {
  display: flex;
  align-items: center;
  padding: 10px;
  border-bottom: 1px solid rgba(255, 248, 253, 0.1);
  cursor: pointer;
  transform: translateX(100%);
  transition-duration: 0.3s;
  transition-property: transform, background-color;
}
.header__inner .buttons .languages li.selected {
  background-color: rgba(255, 150, 66, 0.6);
}
.header__inner .buttons .languages li.selected:hover {
  background-color: rgba(255, 150, 66, 0.7);
}
.header__inner .buttons .languages li:hover {
  background-color: rgba(255, 150, 66, 0.4);
}
.header__inner .buttons .languages li img {
  width: 48px;
  height: 32px;
  margin-right: 10px;
}
.header__inner .buttons .languages li span {
  font-size: 16px;
  font-weight: 700;
  color: #fff8fd;
}

