sources.styles\\modules\\_appear.scss:
$pattern: (
  "up": translateY(100px),
  "down": translateY(-6px),
  "left": translateX(40px),
  "right": translateX(-100px),
);

@each $key, $value in $pattern {
  .appear.#{$key} {
    & .item {
      transform: $value;
    }
  }
}
.appear {
  & .item {
    transition: all 0.8s;
    opacity: 0;
  }
  &.inview {
    & .item {
      opacity: 1;
      transform: none;

      @for $i from 1 through 10 {
        &:nth-child(#{$i}) {
          transition-delay: $i * 0.1s;
        }
      }
    }
  }
}

@keyframes down {
  0%,
  100% {
    transform: translateY(-10px);
    opacity: .1;
  }
  60% {
    transform: translateY(0);
    opacity: 1;
  }
}

sources.styles\\modules\\_arrow.scss:
.arrow {
  font-size: $arrowSize;
  color: $black;
  cursor: pointer;

  &::before  {
    transition: .5s;
  }

  &:hover::before {
    color: $white;
  }

  &-container {
    position: absolute;
    z-index: 400;
    bottom: 5%;
    left: 50%;
    transform: translateX(-50%);
    // width: 100%;
    max-width: 1050px;
    height: 50px;
    opacity: 0;
    transition: 1s;
    // transition-delay: 2s;

    &.inview {
      opacity: 1;

      .arrow {
        &.down {
          transform-origin: top;
          animation: down 2s linear infinite;
        }
        &.right {
          transform-origin: left;
          animation: right 2s linear infinite;
        }
      }
    }
  }
}

.coach, .sns {
  .arrow-container {
    bottom: calc(5% + 17px);
  }
}

@keyframes down {
  0%,
  100% {
    transform: translateY(-10px);
    opacity: 0.1;
  }
  60% {
    transform: none;
    opacity: 1;
  }
}
@keyframes right {
  0%,
  100% {
    transform: none;
    opacity: 0.1;
  }
  60% {
    transform: translateX(10px);
    opacity: 1;
  }
}

