    a {
      position: relative;
      z-index: 1;
      display: inline-block;
      padding: 10px 20px;
      background-color: rgba($black, 0.7);
      color: rgba($orange, 0.8);
      text-decoration: none;
      letter-spacing: 2px;
      font-size: 30px;
      font-weight: 900;
      box-shadow: 0px 2px 10px 1px rgba(0, 0, 0, 0.4);
      transition: color 0.2s, background-color 0.4s;

      span {
        position: absolute;
        z-index: 10;
        display: block;
        background-color: $orange;
        transition: transform 0.3s;
      }

      span:nth-child(1) {
        left: 0;
        bottom: 0;
        width: 3px;
        height: 100%;
        transform: scaleY(0);
        transform-origin: top;
      }
      span:nth-child(2) {
        left: 0;
        bottom: 0;
        width: 100%;
        height: 3px;
        transform: scaleX(0);
        transform-origin: right;
      }
      span:nth-child(3) {
        right: 0;
        bottom: 0;
        width: 3px;
        height: 100%;
        transform: scaleY(0);
        transform-origin: top;
        transition-delay: 0.5s;
      }
      span:nth-child(4) {
        right: 0;
        top: 0;
        width: 100%;
        height: 3px;
        transform: scaleX(0);
        transform-origin: right;
        transition-delay: 0.5s;
      }
      &:hover {
        background-color: rgba($white, 0.8);
        color: $orange;

        span:nth-child(1) {
          transform: scaleY(1);
          transform-origin: bottom;
        }
        span:nth-child(2) {
          transform: scaleX(1);
          transform-origin: left;
        }
        span:nth-child(3) {
          transform: scaleY(1);
          transform-origin: bottom;
          transition-delay: 0.5s;
        }
        span:nth-child(4) {
          transform: scaleX(1);
          transform-origin: left;
          transition-delay: 0.5s;
        }
      }
    }
  }
  .copyright {
    position: absolute;
    bottom: 15px;
    left: 0;
    right: 0;
    font-size: 12px;
    font-weight: 900;
    font-style: italic;
  }
}

@media (max-height: 375px) {
  .link {
    .content {
      padding: 10px 0;
      img {
        max-height: 120px;
        margin-bottom: 10px;
      }

      a {
        padding: 5px 20px;
        font-size: 20px;
      }
    }
  }
}
@media (min-height: 768px) {
  .link {
    .content {
      img {
        max-height: 240px;
      }

      a {
      }
    }
  }
}

